               {balanceHandle &&

               <div className={h.bar__info__balance}

               onMouseEnter={balanceOne}
               onMouseLeave={balanceOneClose}

               >

                   <p className={h.bar__info__title}>Баланс</p>

                   <ul className={h.bar__info__ul}>

                       <Link to={''} className={h.bar__info__balance__ul__link}>9 999 999 ₽</Link>

                   </ul>

               </div>

               }

           </div>

           <div className={h.bar__item}

           onMouseEnter={handleMouseEnter}
           onMouseLeave={handleMouseLeave}

           >

               <img src={bar2}  alt="svg" />

               {showContent &&

               <div className={h.bar__info}

               onMouseEnter={handleMouseEnter}
               onMouseLeave={handleMouseLeave}

